import React, { useEffect, useState } from 'react';

function App() {
  const [wrestlers, setWrestlers] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/wrestlers')
      .then(response => response.json())
      .then(data => setWrestlers(data))
      .catch(error => console.error('Error fetching wrestlers:', error));
  }, []);

  return (
    <div>
      <h1>Wrestler Sorter</h1>
      <ul>
        {wrestlers.map((wrestler, index) => (
          <li key={index}>
            {wrestler.name} ({wrestler.company})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
